package javaSessions;

public class ClassAssignment29thMarch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		/*
		 * WAP to print the output bellow: 000 001 002 003 004 
		 * 010 011 012 013 014
		 * .................. 
		 * 430 431 432 432 434 
		 * 440 441 442 443 444
		 */

		for (int i = 0; i <= 4; i++) {
			for (int j = 0; j <= 4; j++) {
				for (int k = 0; k <= 4; k++) {
					System.out.print(i + "" + j + "" + k + " ");

				}
				System.out.println();
			}
			System.out.println();
		}
		
		//
	}

}
